import{_ as e}from"./plugin-vue_export-helper-c27b6911.js";import{o as t,c as d,f as o}from"./app-131d0148.js";const i="/knowledge/assets/1-aa4ad890.png",a={},c=o('<h1 id="html" tabindex="-1"><a class="header-anchor" href="#html" aria-hidden="true">#</a> HTML</h1><h2 id="div和span的区别" tabindex="-1"><a class="header-anchor" href="#div和span的区别" aria-hidden="true">#</a> div和span的区别</h2><p><code>&lt;span&gt;</code>和<code>&lt;div&gt;</code>唯一的区别在于：<code>&lt;span&gt;</code>是不换行的，而<code>&lt;div&gt;</code>是换行的。</p><p>div在浏览器中，默认是不会增加任何的效果的，但是语义变了，div中的所有元素是一个小区域。 div标签是一个<strong>容器级</strong>标签，里面什么都能放，甚至可以放div自己。</p><p>span也是表达“小区域、小跨度”的标签，但只是一个<strong>文本级</strong>的标签。 就是说，span里面只能放置文字、图片、表单元素。 span里面不能放p、h、ul、dl、ol、div</p><h2 id="html5-新增的内容" tabindex="-1"><a class="header-anchor" href="#html5-新增的内容" aria-hidden="true">#</a> HTML5 新增的内容</h2><figure><img src="'+i+'" alt="HTML5 新增的内容" tabindex="0" loading="lazy"><figcaption>HTML5 新增的内容</figcaption></figure><h2 id="语义化" tabindex="-1"><a class="header-anchor" href="#语义化" aria-hidden="true">#</a> 语义化</h2><p>语义化顾名思义就是能够让开发者更好的阅读和理计、让浏览器更好的解析、更好地SEO（搜索引擎优化）。</p><ul><li><code>&lt;section&gt;</code> 表示区块</li><li><code>&lt;article&gt;</code> 表示文章。如文章、评论、帖子、博客</li><li><code>&lt;header&gt;</code> 表示页眉</li><li><code>&lt;footer&gt;</code> 表示页脚</li><li><code>&lt;nav&gt;</code> 表示导航</li><li><code>&lt;aside&gt;</code> 表示侧边栏。如文章的侧栏</li><li><code>&lt;figure&gt;</code> 表示媒介内容分组。</li><li><code>&lt;mark&gt;</code> 表示标记 (用得少)</li><li><code>&lt;progress&gt;</code> 表示进度 (用得少)</li><li><code>&lt;time&gt;</code> 表示日期</li></ul><p>新语义标签与<code>&lt;div&gt;</code>、<code>&lt;span&gt;</code>没有区别，只是其具有表意性，可以理解成<code>&lt;div class=&quot;header&quot;&gt;</code> 等同于<code>&lt;header&gt;</code>。</p>',11),l=[c];function r(n,s){return t(),d("div",null,l)}const p=e(a,[["render",r],["__file","1.HTML.html.vue"]]);export{p as default};
